  //         day: shiftData.day,
  //         start_hour: shiftData.start_hour,
  //         end_hour: shiftData.end_hour,
  //       },
  //     ];
  //   })

  //   // shifts.forEach((shift) => {
  //   //   shift.idList.forEach((id) => {
  //   //     workers_map[id].shifts = [
  //   //       ...workers_map[id].shifts,
  //   //       {
